import React from 'react'

const PriceTag = (props) => {
    return(
        <div className = "flex flex-col items-center justify-center">
            <h1 className = "text-tooltip font-artistic font-extrabold mt-10 text-white"><i class="fas fa-dollar-sign"> {props.price}</i></h1>
            <h1 className = "text-xl font-artistic font-extrabold text-white">{props.weight} g</h1>
        </div>
    )
}

export default PriceTag;
